let currentX = 0
let currentY = 0
let currentZ = 0
const originX = this.position.x
const originY = this.position.y
const originZ = this.position.z
const moveX = 0 - originX
const moveY = 0 - originY
const moveZ = 0 - originZ
let animate=()=>{
  requestAnimationFrame( animate )
  if(Math.abs(currentX) < Math.abs(moveX)
  || Math.abs(currentY) < Math.abs(moveY)
  || Math.abs(currentZ) < Math.abs(moveZ)){
    this.position.x += moveX / 60;
    this.position.y += moveY / 60;
    this.position.z += moveZ / 60;
    currentX += moveX / 60
    currentY += moveY / 60
    currentZ += moveZ / 60
  }
}
animate()
